import React, { useContext } from "react";
import PaymentFormComponent from "./PaymentFormComponent";
import TransactionContext from "../../../../Context/TransactionContext";
const DisplayOperations = (id,operation) => {
    const { operations } = useContext(TransactionContext);
    let data = operations.find(op=>op.id === id).operationData;
    const AllOperations = {
        payment: <PaymentFormComponent data={data} />
    }
    return AllOperations[operation];
    
}
export default DisplayOperations;
